import React from "react";
import { Dropdown, Menu } from "semantic-ui-react";

const options = [
  { key: 1, text: "강남구", value: 1 },
  { key: 2, text: "마포구", value: 2 },
  { key: 3, text: "송파구", value: 3 },
  { key: 4, text: "종로구", value: 4 },
  { key: 5, text: "서대문구", value: 5 },
];

const DropdownExampleSimple = () => (
  <Menu compact>
    <Dropdown text="지역을 선택하세요" options={options} simple item />
  </Menu>
);

export default DropdownExampleSimple;
